import React from 'react';
import './navbar.css';

const Navbar = () => {
  return (
    <nav>
      <div className="navbar-logo">
        <img src="logo.png" alt="Logo" />
      </div>
      <ul className="navbar-menu">
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
        <li>Item 4</li>
        <li>Item 5</li>
      </ul>
      <div className="navbar-logout">
        <ul>
          <li>Logout</li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
